import React from "react";
import "./button.scss";

const Button = ({ buttonLink, label, handlers }) => {
  return (
    <button
      {...handlers}
      className={`button animation${buttonLink ? " button-link" : ""}`}
    >
      {label}
    </button>
  );
};

export default Button;
